import React from 'react' ;
import './MainStyle.css' ;
import UserList from './UserList';
import OnHover from './OnHover'

export class Table extends React.Component {
    render() {
        return (
            <div className = "Main-div">
                <table>
                    <thead>
                        <th>Id</th>
                        <th>Name</th>
                        <th>Age</th>
                        <th>E-mail</th>
                        <th>Address</th>
                    </thead>
                    <UserList />
                    <UserList />
                    <UserList />
                    <UserList />
                    <UserList />
                </table>
                <OnHover />
            </div>
        );
    }
}
